export default(o,a)=>{const e=document.querySelector(o),t=document.querySelector(a);e.addEventListener("change",function(){const r=new URL(window.location.href);r.searchParams.set("tenant",e.value),t.disabled=!0,fetch(r).then(n=>n.text()).then(n=>{const s=new DOMParser().parseFromString(n,"text/html").querySelector(a);t.innerHTML=s.innerHTML||"",t.options[0].dataset.value=e.options[e.selectedIndex].dataset.value,t.disabled=!1,t.dispatchEvent(new Event("change"))})}),e.dispatchEvent(new Event("change"))};
